import React from 'react';
import './FaceRecognition.css'
const FaceRecognition = ( {imageUrl , box} ) => {
	return (
		<div className = 'center ma'>
			<div className = 'abdolute mt2'>
				<img id = 'inputimage'
					 alt = '' 
					 src = { imageUrl } 
					 width = '500px' 
					 height = 'auto'/>
				<div className = 'bounding-box' 
					 style = {{
					 	top: box.leftCol,
					 	right: box.topRow,
					 	bottom: box.rightCol,
					 	left: box.bottomRow
					 	}}>
				</div>
			</div>
		</div>
		);
}

export default FaceRecognition;
